import React from "react";
import "../Footer.scss";
const Services = () => {
  return (
    <div className="services">
      <h3>SERVICES</h3>
      <div className="services-list">
        <ul>
          <li>cooked</li>
          <li>deliver</li>
          <li>quality foods</li>
          <li>mixed</li>
        </ul>
      </div>
    </div>
  );
};

export default Services;
